import React, {useState, useEffect} from 'react';
import './NameHeaderComponent.css'


export const NameHeader = (props) => {
    let name= ["S","K","I","D","M","O","R","E"," ","C","S"," ","C","L","U","B"]
    let nameToAdd =[]
    name.forEach((letter)=> {
        nameToAdd.push(<h2 className='letter'>{letter}</h2>)
    })

    const Changecolor = (interval) => {

        document.getElementsByClassName('letter')[interval].style.color = "blue";
    }

    React.useEffect(() => {
        for (let i =0; i<name.length;i++) {
            setInterval(Changecolor,5000)
        }
    })


    return (
        <div className='flexBox'>
            {nameToAdd}

        </div>
    )

}
